import React from "react";

const Home = () => {
  return (
    <div>
      <div className="hero">
        <div className="card bg-dark text-white border-0">
          <img
            src="https://volsiz.ru/wp-content/uploads/2021/12/amazon-840x400.jpg"
            className="card-img"
            alt="Background"
          />
          <div className="card-img-overlay">
            <div className="text-center">
              <h5 className="card-title">NEW SEASON ARRIVALS</h5>
              <p className="card-text text-lowercase">
                CHECK OUT ALL THE TRENDS
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
